func testInstanceProviderToManyInstances(t *testing.T) {
	var err error
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a InstanceProvider
	var b, c Instance

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, instanceProviderDBTypes, true, instanceProviderColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize InstanceProvider struct: %s", err)
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	if err = randomize.Struct(seed, &b, instanceDBTypes, false, instanceColumnsWithDefault...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &c, instanceDBTypes, false, instanceColumnsWithDefault...); err != nil {
		t.Fatal(err)
	}

	b.InstanceProviderID = a.ID
	c.InstanceProviderID = a.ID

	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := a.Instances().All(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	bFound, cFound := false, false
	for _, v := range check {
		if v.InstanceProviderID == b.InstanceProviderID {
			bFound = true
		}
		if v.InstanceProviderID == c.InstanceProviderID {
			cFound = true
		}
	}

	if !bFound {
		t.Error("expected to find b")
	}
	if !cFound {
		t.Error("expected to find c")
	}

	slice := InstanceProviderSlice{&a}
	if err = a.L.LoadInstances(ctx, tx, false, (*[]*InstanceProvider)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if got := len(a.R.Instances); got != 2 {
		t.Error("number of eager loaded records wrong, got:", got)
	}

	a.R.Instances = nil
	if err = a.L.LoadInstances(ctx, tx, true, &a, nil); err != nil {
		t.Fatal(err)
	}
	if got := len(a.R.Instances); got != 2 {
		t.Error("number of eager loaded records wrong, got:", got)
	}

	if t.Failed() {
		t.Logf("%#v", check)
	}
}

